import React from 'react'
import './App.css';
import { Header } from '../../layouts/Header/Header'
import { Main } from '../../layouts/Main/Main'

export const Home = () => {
  return (
    <body >
      <header>
        <Header/>
      </header>
      <main>
        <Main/>
      </main>
    </body>
  )
}
